import React from "react";
import MainImage from "./MainImage";
import "./ForecastDaily.css";

export default function ForecastDaily() {
  return (
    <div className="ForecastDaily">
      <div className="Card" id="Forecastcard">
        <h2>Daily Forecast</h2>
      </div>
      <div className="Forecastdays" id="Forecastdays">
        <div className="Card" id="Forecastcard">
          <div className="row">
            <span>Wednesday Sep 28</span>
            <MainImage icon="03n" size="50" />
            <span>17° 10°</span>
          </div>
        </div>
      </div>
    </div>
  );
}
